import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="header">
                <div className="header__logo">
                    <img src="https://i.ibb.co/5Y3mZ5Y/logo.png" alt="logo" />
                </div>
                <div className="header__title">
                    <h1>React-Redux-Saga</h1>
                </div>
            </div>
    </div>
  );
}

export default App;
